import React, { Component } from 'react';
import Header from '../../components/header';

// Style
import './styles.scss';

class Home extends Component {
  render() {
    return (
      <div className='home-page-style'>
        <div class='header-banner-style'>
          <div className='container'>
            <Header />
          </div>
        </div>
      </div>
    );
  }
}

export default Home;
